!function(){"use strict";function MoveListDirective(){return{restrict:"EA",require:"ngModel",scope:{selectedLabel:"@",availableLabel:"@",displayAttr:"@",all:"=",numItems:"@",model:"=ngModel"},template:'<div class="multiSelect"><div class="select"><label class="control-label" for="multiSelectAvailable">{{ availableLabel }} ({{ available.length }})</label><select ng-model="selected.available" multiple ng-options="e as e[displayAttr] for e in available" ng-size="{{ numItems }}"></select></div><div class="select buttons"><button class="btn mover left" ng-click="add()" title="Add selected" ng-disabled="selected.available.length == 0"><i class="glyphicon glyphicon-arrow-right"></i></button><button class="btn mover right" ng-click="remove()" title="Remove selected" ng-disabled="selected.current.length == 0"><i class="glyphicon glyphicon-arrow-left"></i></button></div><div class="select"><label class="control-label" for="multiSelectSelected">{{ selectedLabel }} ({{ model.length }})</label><select ng-model="selected.current" multiple class="pull-left" ng-options="e as e[displayAttr] for e in model ng-size="{{ numItems }}"></select></div></div>',link:function(scope,elm,attrs){function filterAvailable(all,selected){var available=all.filter(function(item){var is_selected=selected.reduce(function(item_is_selected,selected_item){return item_is_selected||angular.equals(item,selected_item)},!1);return!is_selected});return available}scope.selected={available:[],current:[]},scope.refreshAvailable=function(){scope.available=filterAvailable(scope.all,scope.model),scope.selected.available=[],scope.selected.current=[]},scope.add=function(){scope.model=scope.model.concat(scope.selected.available),scope.refreshAvailable()},scope.remove=function(){scope.model=filterAvailable(scope.model,scope.selected.current),scope.refreshAvailable()}}}}angular.module("autovance.av-move-list",[]).directive("avMoveList",MoveListDirective)}();